INSERT INTO `product` VALUES (4,2,'圣诞系列','红与绿的碰撞，是好运和心动的双重奔赴～\n戴上这串，坐等好事发生\n绿草莓晶红玛瑙贝珠\n尺寸约6/8/10mm','/admin/common/image/others/dc0326d4-ba17-49ba-a9e7-94114de92886.jpg',128.00,35.00,20,1,'2025-12-23 11:59:14'),(5,2,'奶茶月光','该怎么形容月光的温柔呢\n每一颗都闪烁着温柔治愈的光\n奶茶月光石榴石切面黄水晶\n尺寸约9mm','/admin/common/image/others/1022bfe4-b284-41f5-b3d3-c6808bcfe809.jpg',188.00,0.00,20,1,'2025-12-23 12:01:38'),(6,2,'平安环·多宝红绳','和田玉平安扣，和田玉，翡翠，红玛瑙，黄玛瑙，贝珠，切面黄水晶，翡翠算盘珠\n尺寸约6mm','/admin/common/image/others/08c74399-b739-472e-9afa-301023d30efb.jpg',188.00,0.00,20,1,'2025-12-23 12:05:14'),(7,1,'金竹碧玉','金竹碧玉真的太雅了！\n竹子本来就是清风雅韵的代表 再配上温润的和田玉碧玉','/admin/common/image/others/282715c3-563e-4f95-b861-e74bfbe08624.jpg',199.00,0.00,20,1,'2025-12-23 12:06:54'),(8,4,'红玛瑙手镯（备注圈口','秋冬红色系！！果然显得气血很好的样子！！\n我想谁也逃不掉红色系！妈妈都夸我会买！！\n上手立马显白n个度！！！','/admin/common/image/others/0a8bcb2e-9791-489c-888e-7f5f794d5691.jpg',188.00,0.00,20,1,'2025-12-23 12:09:39'),(9,2,'翡翠叶子','天然翡翠~福利款\n一份预算，两份快乐！解锁 “手串 + 项链” 双穿搭，闭眼入不踩雷～','/admin/common/image/others/f5aee6cd-ceba-4c24-851f-f93195c770e0.jpg',69.90,0.00,20,1,'2025-12-23 12:25:28'),(10,4,'天山翠（备注圈口','天山翠，山河清影中式美\n国风美学无可替代，每支都是独一无二的美','/admin/common/image/others/b3111586-b1e3-4d0a-87fc-00a23ce54ff2.jpg',268.00,0.00,20,1,'2025-12-23 12:39:07'),(11,2,'紫水晶1','人间绝绝紫～\n乌拉圭·巴西紫水晶','https://cloud.xiaotangstory.top/admin/common/image/others/aa17ccf1-25db-4fd8-8163-ac4e182374ff.jpg',168.00,0.00,1,0,'2025-12-23 12:43:01'),(12,2,'黄塔晶1','甜奶油招米黄塔晶\n没人能抗拒这样富贵的水晶手串！！\n尺寸约8mm','/admin/common/image/others/b7bd75b2-1707-4dda-b376-e8244ab03ba1.jpg',168.00,0.00,20,1,'2025-12-23 12:53:48'),(13,2,'黄塔晶2','爱财爱己 风生水起\n这串金灿灿手链也太戳心了吧！\n爱自己才是上上签 腕间的小太阳戴上它，仿佛被温暖的阳光拥抱像把一小束凝固的阳光绕在了手腕上～\n\n黄塔晶/黄阿塞 \n尺寸约8/10.5mm','/admin/common/image/others/a9397845-1cf7-44a4-86a2-5e7a3e2346ef.jpg',158.00,0.00,20,1,'2025-12-23 12:59:39'),(14,2,'南红1','冰飘南红，红玛瑙，和田玉跑环\n若惊鸿，是美在千变万化的冰飘南红\n灵动带着神秘\n每一颗都是不一样的存在\n尺寸约6/8/10mm','/admin/common/image/others/70c1a24e-98d8-4a40-9b86-3e95d69ce0b6.jpg',188.00,0.00,20,1,'2025-12-23 13:02:40'),(15,2,'西柚粉水晶手串','\n西柚粉水晶手串\n谁能拒绝把“温柔氛围感”焊在手上啊\n软fufu的粉水晶自带温柔滤镜，甜而不腻的精致感拉满~戴上手显白又抬气质，日常通勤/约会都适配！','/admin/common/image/others/b39302b6-503f-43f3-93cd-e351bf35486d.jpg',188.00,0.00,20,1,'2025-12-23 13:11:01'),(16,5,'银镶嵌水沫玉葫芦','','/admin/common/image/others/dc0ea30f-f592-4798-b04d-5ce0a12bcef0.jpg',188.00,0.00,20,1,'2025-12-25 14:05:14'),(17,1,'和田玉佛公（厚）','','/admin/common/image/others/619e54a1-e1c2-4552-98a8-e1db214b3216.jpg',288.00,0.00,20,1,'2025-12-25 14:06:27'),(18,1,'银镶嵌和田玉小马','好可爱的珐琅纯银\n和田玉小马润润透透的超可爱呀～\n有着马到成功 马上有钱的寓意\n是年轻人都拒绝不了的中式浪漫～','/admin/common/image/others/ed33900c-7b2d-4812-88f4-1b2010bc6d48.jpg',199.00,0.00,20,1,'2025-12-25 14:08:25'),(19,4,'香芋紫手镯（备注圈口','香芋紫~原矿色就是美腻！','/admin/common/image/others/dfac0bd8-4816-4a2c-af0e-823ef3de477c.jpg',688.00,0.00,20,1,'2025-12-25 14:09:40'),(20,2,'紫黄水晶','年头紫到年尾氛围感包的呀～\n不愧是火了很久的紫黄搭子\n一紫一黄，一财一智！\n直接把这款焊在手手～\n\n紫塔晶，黄塔晶，黑金超，紫阿塞方糖.黄阿塞跑环\n\n尺寸约12mm','/admin/common/image/others/769e7506-535f-4796-8590-cfe2e8b050b4.jpg',248.00,0.00,20,1,'2025-12-25 14:12:33'),(21,2,'黄阿塞千层幽灵多圈','\n\n黄阿塞，千层幽灵\n尺寸约7/12mm','/admin/common/image/others/bd5599c7-0ba1-47f2-81f0-2c575abe4d8e.jpg',199.00,0.00,20,1,'2025-12-25 14:21:07'),(22,2,'奶茶月光黑曜石多圈','腕间的反差感美学\n黑曜石的深邃像漫漫长夜\n奶茶月光的朦胧光晕恰似破晓的柔光\n戴上就不想摘下来的神仙组合\n尺寸约6/10mm  铜配件','/admin/common/image/others/c6ec4007-5344-47d6-b4cf-54237b0425f1.jpg',169.00,0.00,20,1,'2025-12-25 14:23:31'),(23,2,'黑月光红胶花','','/admin/common/image/others/462a8293-06da-49d2-ac54-c1a25d3179cd.jpg',268.00,0.00,19,1,'2025-12-25 14:42:36'),(25,2,'测试商品','','/admin/common/image/others/03642529-feda-4ce4-824e-b8e12dc86684.png',999.00,0.00,0,1,'2025-12-25 22:50:24');
